import React from "react"; 

const RouterService = () => {
    return (
        <>
        <div className = "container w-50 my-5 text-center serviceSearch">
            <h1 className = "text-capitalize text-primary">Search For Our services and items</h1>
            <input type = "text"  placeHolder = "Search anything"/>
        </div>
            
        </>
    );
}

export default RouterService;
